import React from "react";
import {useState, useEffect} from 'react'

function App() {

  return (
    <div className="w-full bg-neutral-900 h-screen">
      <h1 className="text-4xl text-center m-auto pt-5 font-bold text-neutral-200 select-none">Project Practice</h1>
      <div className="search-container flex justify-center w-full">
        <input className="w-1/3 border-2 rounded-xl block mt-5 bg-neutral-900 border-neutral-700 p-2" placeholder="Search..."></input>
        <button className="Search mt-5 block rounded-xl bg-neutral-800 text-neutral-200">Search</button>
      </div>
    </div>
  );
}

export default App;
